wrc-ancillary-content.tips.cards.tip0.descriptionHTML=<p>\u5728\u63a7\u5236\u53f0\u9876\u90e8\u7684\u641c\u7d22\u5b57\u6bb5\u4e2d\u8f93\u5165\u641c\u7d22\u8bcd\uff0c\u4ee5\u68b3\u7406\u5f53\u524d\u900f\u89c6\u56fe\u4e2d\u7684\u5339\u914d\u9879\u3002\u60a8\u8fd8\u53ef\u4ee5\u5728<b>\u6700\u8fd1\u641c\u7d22</b>\u8282\u70b9\u4e2d\u91cd\u65b0\u8bbf\u95ee\u4ee5\u524d\u7684\u67e5\u8be2\u3002</p>
