wrc-ancillary-content.tips.cards.tip1.descriptionHTML=<p>\u901a\u8fc7\u4eea\u8868\u76d8\uff0c\u53ef\u4ee5\u5b9a\u4e49\u5b9a\u5236\u6807\u51c6\uff0c\u5c06\u5176\u4e0e\u60a8\u7684\u57df\u8fdb\u884c\u5339\u914d\uff0c\u5e76\u6839\u636e\u57df\u751f\u6210\u5168\u9762\u4e14\u51c6\u786e\u7684\u62a5\u544a\u3002</p><p>\u8981\u5f00\u59cb\u4f7f\u7528\uff0c\u8bf7\u6253\u5f00<b>\u76d1\u89c6\u6811</b>\u4e2d\u7684\u4efb\u4f55\u8282\u70b9\uff0c\u7136\u540e\u5355\u51fb<b>\u65b0\u5efa\u4eea\u8868\u76d8</b>\u3002\u6216\u8005\uff0c\u6253\u5f00<b>\u4eea\u8868\u76d8</b>\u9876\u7ea7\u8282\u70b9\u67e5\u770b\u5185\u7f6e\u4eea\u8868\u76d8\u3002</p>
