wrc-ancillary-content.tips.cards.tip11.descriptionHTML=<p>\u4f7f\u7528\u952e\u76d8\u5feb\u6377\u65b9\u5f0f\u76f4\u63a5\u8df3\u8f6c\u5230\u7279\u5b9a\u7684 UI \u7ec4\u4ef6\u3002</p><p>\u524d 5 \u4e2a\uff1a</p><li><code><b>Alt+P</b></code> - \u6253\u5f00<b>\u63d0\u4f9b\u7a0b\u5e8f</b>\u62bd\u5c49\u3002</li><li><code><b>Alt+C</b></code> - \u5c06\u7126\u70b9\u79fb\u52a8\u5230<b>\u8d2d\u7269\u8f66</b>\u3002</li><li><code><b>Alt+T</b></code> - \u5c06\u7126\u70b9\u79fb\u52a8\u5230\u8868\u4e2d\u7684\u7b2c\u4e00\u5217\u6807\u9898\u3002</li><li><code><b>Alt+|</b></code> - \u5c06\u7126\u70b9\u79fb\u52a8\u5230\u5bfc\u822a\u6811\u5bbd\u5ea6\u8c03\u6574\u5927\u5c0f\u5de5\u5177\u3002\u4f7f\u7528\u65b9\u5411\u952e\u66f4\u6539\u6811\u7684\u5bbd\u5ea6\u3002</li><li><code><b>Alt+;</b></code> - \u5c06\u7126\u70b9\u79fb\u52a8\u5230\u7b2c\u4e00\u4e2a\u53ef\u5355\u51fb\u7684\u9762\u5305\u5c51\u6807\u7b7e\u3002</li></ul><p>\u6709\u5173\u952e\u76d8\u5feb\u6377\u65b9\u5f0f\u7684\u5b8c\u6574\u5217\u8868\uff0c\u8bf7\u53c2\u9605\u6587\u6863\u3002</p>
